import react from "react";
function ExpenseDate(props){

    const month = props.date
    const day = props.date
    const year = props.date

    return (
        <>
         <div>
                    <div>{month}</div>
                    <div>{year}</div>
                    <div>{day}</div>
                </div>

        </>
    );
}

export default ExpenseDate();
